css:
.git-control .files {
  width: 100%;
  margin-bottom: 15px;
}
.git-control .files .placeholder {
  display: none;
}
.git-control .files.none .placeholder {
  display: block;
  color: rgba(173, 170, 164, 0.6);
}
.git-control .files .file,
.git-control .files .allfiles {
  position: relative;
  margin: 2px 0 2px 16px;
  padding: 2px 5px;
  border-radius: 4px;
}
.git-control .files .file .clickable.text,
.git-control .files .allfiles .clickable.text {
  width: 80%;
  display: inline;
  position: absolute;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
  margin: 5px 0 0 45px;
}
.git-control .files .file.deleted,
.git-control .files .allfiles.deleted {
  color: rgba(173, 170, 164, 0.6);
}
.git-control .files .file.modified,
.git-control .files .allfiles.modified {
  color: #e2c08d;
}
.git-control .files .file.new,
.git-control .files .allfiles.new {
  color: #73c990;
}
.git-control .files .file.conflict,
.git-control .files .allfiles.conflict {
  color: #ff6347;
}
.git-control .files .file .icon.check,
.git-control .files .allfiles .icon.check {
  color: rgba(173, 170, 164, 0.6);
  opacity: 0.5;
}
.git-control .files .file.active .icon.check,
.git-control .files .allfiles.active .icon.check {
  color: #dddcda;
  opacity: 1.0;
}
